INSERT INTO `vacations` VALUES (2,72,'Relax and unwind on a luxury cruise through the crystal-clear waters of the Caribbean, visiting multiple islands along the way.','2026-04-17','2026-04-17',1230,'7ec3b08b-d902-41fd-b7a7-fd926e37ec1f.jpg'),(3,167,'Come visit the royal palace with a chance to win a signed sword from the swedish king Carl XVI Gustaf! And that\'s not all! Abba is in town and whoemever gets the sword can expirience a free concert with all the original members in a private concert at the Radisson Blu Waterfront Hotel! Afterwords a session of autographs and a Q&A with the band and the best quality of local food! Will you be the one to be crowned with an abba concert? Only one way to find out! come to sweden today!','2026-06-05','2026-06-12',8666,'677d2a93-b0ec-41a1-b311-9060ccedd11d.png'),(5,32,'Hit the slopes in world-renowned ski resorts such as Whistler Blackcomb in British Columbia or Banff in Alberta.','2026-10-10','2026-10-17',2700,'e38bdc4b-d137-4966-8368-410fb0940cce.png'),(9,136,'Explore the ancient ruins of Machu Picchu, hike the Inca Trail, and discover the vibrant culture of Peru.','2027-06-05','2027-06-12',3442,'4308732e-eec0-40f0-8517-a354ff47d5ac.png'),(10,123,'Embark on an epic road trip across New Zealand, exploring stunning landscapes, fjords, and Maori culture.','2027-08-20','2027-08-27',2800,'4c797a6f-ec7c-4656-b0ef-90c82a4230e1.jpg'),(11,78,'Rejuvenate your mind, body, and soul with yoga, meditation, and spa treatments in the tranquil surroundings of Bali.','2025-10-10','2025-10-17',3200,'f94408fb-7887-444e-b498-b6379d010409.jpg'),(12,129,'Sail through breathtaking fjords, admire cascading waterfalls, and witness the stunning natural beauty of Norway.','2028-01-15','2028-01-22',2700,'4ef619f1-88d6-4db0-acff-eddaf8f03b2b.jpg'),(35,168,'Experience the country with beautiful cold landscapes, fresh rivers and the best chocolate in the world!','2024-10-26','2024-10-29',1190,'07cd1407-31a3-4764-8da6-ed7759863586.png'),(37,76,'Explore the otherworldly landscapes of Iceland, including waterfalls, glaciers and the greenest landscape you\'ve ever seen! Experience the beautiful sights of the aurora borealis in a once in a lifetime expirience at the Reykjavik northen lights show! Meet our wonderfull snowboarding experts that can show you a once in a lifetime pinguin snowboarding show! And that\'s not all! Try unique dishes like Hakarl and Plokkfiskur with the freshest fish you will ever eat at prices that are guaranteed to be cheaper than home!','2024-08-30','2024-08-31',598,'169d7d9c-9ca8-4e01-96e3-d621522aa3c2.png'),(41,9,'Come visit the famous Sydney Opera House to see the world famous Phantom of the Opera with the original cast!','2027-07-29','2027-08-11',1461,'281858d8-eae5-4140-9bac-b39ebb717ca6.png'),(44,137,'come for an underground river tour through a mesmerizing cave system, complete with audio guides and the chance to spot wildlife amidst stunning mountain scenery. Enjoy serene boat rides and natural wonders.','2024-11-29','2024-12-06',1736,'2f9a950c-ca77-40ee-a8e3-3d3c47986174.jpg'),(47,76,'Iceland Vacation','2024-10-12','2024-11-12',9000,'0b36fed3-5e96-46e6-8a5f-180a2c3c0087.png'),(48,40,'Costa Rica Vacation','2024-05-25','2024-06-01',1209,'8e2c5a88-e5f4-4e6a-ba3a-fff47f963e73.jpg'),(49,43,'Cyrprus Vacation','2024-08-14','2024-09-01',5600,'8240438d-064d-45ca-bec8-98b588b63846.png'),(50,141,'Romania Vacation','2024-10-12','2024-10-31',7000,'986af268-3951-4e54-8ee5-cc3168952197.jpeg');
